wingman.userCommands  type: array default: [{'command': 'exImprove', 'label': 'Suggest improvements', 'userMessageTemplate': 'I have the following {{language}} code:
```{{filetype}}
{{text_selection}}
```
Please provide a list of suggestions for improving the code in markdown format. Consider aspects such as readability, performance, maintainability, and best coding practices. Explain each suggestion briefly, highlighting the specific areas that could be enhanced. Your suggestions should aim to improve the code without changing its behavior.', 'systemMessageTemplate': 'You are an assistant to a {{language}} developer.', 'callbackType': 'none', 'category': 'My prompts'}] description: User-defined prompt command templates.
